window.jsPDF = window.jspdf.jsPDF;

function generatePDF(data){
  const pdf = new jsPDF({
    unit: "in",
    format: [3.15, 6.49],
    orientation: "portrait",
  });

  date = new Date(data[5]);

  const months = [
    "January", "February", "March", "April", "May", "June",
    "July", "August", "September", "October", "November", "December"
  ];

  const monthName = months[date.getMonth()];
  const year = date.getFullYear();

  const formattedDate = `${monthName} ${year}`;
  const balance = data[6] - data[8];
  
  const tableData = [
    ["Roll No", data[1]],
    ["Student Name", data[2]],
    ["Father Name", data[3]],
    ["Course", data[4]],
    ["Fee Month", formattedDate],
    ["Course Fee", data[6]],
    ["Monthly Received", data[7]],
    ["Total Received", data[8]],
    ["Total Balance", balance.toString()],
  ];

  const logoData =
    "data:image/png;base64,";

  function alignCenter(text, y) {
    const textWidth =
      (pdf.getStringUnitWidth(text) * pdf.internal.getFontSize()) /
      pdf.internal.scaleFactor;
    const x = (pdf.internal.pageSize.getWidth() - textWidth) / 2;
    pdf.text(text, x, y);
  }

  function alignTableContent(text) {
    const textWidth =
      (pdf.getStringUnitWidth(text) * pdf.internal.getFontSize()) /
      pdf.internal.scaleFactor;
    const x = (1.55 - textWidth) / 2;
    return x;
  }

  const pageWidth = pdf.internal.pageSize.getWidth();
  const imageWidth = 1;
  const imageCenter = (pageWidth - imageWidth) / 2;
  pdf.addImage(logoData, "PNG", imageCenter, 0.1, 1, 1);
  pdf.setFontSize(12);
  pdf.setFont("helvetica", "bold");
  pdf.setTextColor(178, 45, 48);
  alignCenter("TAJ INSTITUTE OF INFORMATION", 1.35);
  alignCenter("TECHNOLOGY", 1.55);
  pdf.setFontSize(10);
  pdf.setFont("helvetica", "normal");
  pdf.setTextColor(0, 0, 0);
  alignCenter("051-4474871", 1.8);
  alignCenter("tajinstitute.com.pk", 2);
  alignCenter("Office # 1, First Floor, Aman Plaza, Near", 2.2);
  alignCenter("Jahaz ground stop, khanna road, Rawalpindi", 2.4);
  pdf.setFont("helvetica", "bold");
  date = new Date();
  dateinWords = date.toLocaleDateString("en-US", {
    year: "numeric",
    month: "short",
    day: "numeric",
  });
  time = date.toLocaleTimeString("en-US", {
    hour: "numeric",
    minute: "numeric",
    hour12: true,
  });
  pdf.text("Date: " + dateinWords,  0.2, 2.65);
  pdf.text("Time: " + time, 1.8, 2.65);
  alignCenter("Bill No:"+data[0], 2.9);
  pdf.setFont("helvetica", "normal");

  let y = 3.05;
  pdf.setLineWidth(0.01);
  tableData.forEach((row, i) => {
    if (i == 3) {
      if (pdf.getTextWidth(" " + row[1] + " ") < 1.55) {
        pdf.rect(0.125, y, 1.35, 0.275);
        pdf.rect(1.475, y, 1.55, 0.275);
        pdf.setFont("helvetica", "bold");
        pdf.text(row[0], 0.2, y + 0.225);
        pdf.setFont("helvetica", "normal");
        pdf.text(row[1], 1.55, y + 0.225);
        y += 0.275;
      } else {
        pdf.rect(0.125, y, 1.35, 0.5);
        pdf.rect(1.475, y, 1.55, 0.5);
        pdf.setFont("helvetica", "bold");
        pdf.text(row[0], 0.2, y + 0.25);
        pdf.setFont("helvetica", "normal");
        const words = row[1].split(" ");
        if (pdf.getTextWidth(" " + words.slice(0, 3).join(" ") + " ") > 1.55)
          index = 2;
        else index = 3;
        const firstWords = words.slice(0, index).join(" ");
        const remainingWords = words.slice(index).join(" ");
        pdf.text(firstWords, 1.475 + alignTableContent(firstWords), y + 0.2);
        pdf.text(
          remainingWords,
          1.475 + alignTableContent(remainingWords),
          y + 0.4
        );
        y += 0.5;
      }
    } else {
      pdf.rect(0.125, y, 1.35, 0.275);
      pdf.rect(1.475, y, 1.55, 0.275);
      pdf.setFont("helvetica", "bold");
      pdf.text(row[0], 0.2, y + 0.225);
      pdf.setFont("helvetica", "normal");
      pdf.text(row[1], 1.55, y + 0.225);
      y += 0.275;
    }
  });
  pdf.setFont("helvetica", "bold");
  pdf.setFontSize(12);
  alignCenter("Thank You", y + 0.35);
  pdf.setTextColor(178, 45, 48);
  pdf.setFontSize(10);
  alignCenter("Powered By TAJ INSTITUTE", y + 0.55);
  window.open(pdf.output("bloburl"), "_blank");
}
